import { makeStyles } from '@material-ui/core/styles';

export const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },

    forSelect: {
      margin: theme.spacing(1),
      minWidth: 120,
      maxWidth: 300,
    }
  }));
